List as an Overlay rather than a Sequence. I think this would be a fun way to practice composing in ET(31), etc.

```
{ f: 220, l: 1, g: 1, p: 0 } 

main = {
    &[Fm 1, Fm 9/8] % [:]
}

expect = {
    Overlay [Fm 1, Fm 9/8]
}
```

Adds `Lambda` syntax. 

In my last round of composing I realized that something like a lambda would be useful. It's always a bit sad when I have to write something different than I hear, because the language doesn't support the sound I'm imagining. The last PR refactored how scope works in the language so that this extension could be implemented reasonably. 

```
{ f: 220, l: 1, g: 1, p: 0 } 

main = {
  Seq [Fm 3/2, Fm 1, Fm 7/8]
  | Overlay [
    AsIs,
    \ (input) {
      Seq [Fm 1, Fm 9/8] | FitLength input
    }
  ]
}

expect = {
  Overlay [
    Seq [Fm 3/2, Fm 1, Fm 7/8],
    -- If the second melody was not in the lambda, this line would say
    -- Seq [Fm 3/2, Fm 1, Fm 7/8] | Seq [Fm 1, Fm 9/8]   Seq [Fm 3/2, Fm 1, Fm 7/8],
    Seq [Fm 1, Fm 9/8] | Lm 3/2 
  ]
}
```

Language for stem printing. 

```{ f: 311.127, l: 1, g: 1, p: 0 }

thing1 = {
  O[
    (1/1, 2, 1, 1),
    (1/1, 0, 1, -1),
  ]
  | Seq [
    Fm 1, Fm 9/8, Fm 5/4
  ]
}

main = {
  #thing | Overlay [
    thing1,
  ]
}
-> [thing1]
```
